import React, { Component } from 'react';
import SongsContainer from '../../containers/SongsContainer';

class Song extends Component {

  render() {
    const { song } = this.props;

    return (

      <div>
        <li>
          {song.title}
          <SongsContainer song={song}/>
        </li>
      </div>

    );
  }
};

export default Song;
